import Slide from "../components/slider"
import Navigator from "../components/navigator"
import Drive from "../components/testdrive"
import Footer from "../components/footer"

function Derek() {
    return (
        <>
            <Slide/>
            <Navigator/>
            <Drive/>
            <Footer/>
        </>
    )

}
export default Derek;
